import axios from 'axios';
import { BASE_URL } from '../constants/Url';

const EnterpriseOrderApi = async (planPeriod, quantity, payment) => {
    try {
        const response = await axios.post(
            `${BASE_URL}/orders/enterprise`,
            {
                planPeriod: planPeriod,
                quantity: quantity,
                payment: payment,
            },
            {
                headers: {
                    auth: localStorage.getItem('token'),
                },
            }
        );
        return response.data;
    } catch (error) {
        console.log(error);
    }
}

export default EnterpriseOrderApi;
